    <div>
    <main>
        <Nav />
        <h3>Resume</h3>
        <Table striped>
          {Object.entries(resumeData).map(([key, value]) => 
            <thead>
                <tr>
                    <th>{resumeData.key}HEAD</th>
                    <th>{resumeData.jobTitle}</th>
                    <th>{resumeData.date}</th>
                </tr>
            </thead>
  )}

            <tbody>
          {/* {resumeData.map((data) => 
                <tr>

                    <td>{data.note1}</td>
                    <td>{data.note2}</td>
                    <td>{data.note3}</td>
                    <td>{data.note4}</td>
                </tr>
          )} */}
            </tbody>
        </Table>
    </main>
    </div>
  );
};

